import React from "react";
import "./news.css";

const news = props => {
  return (
    <div>
      <div className="gettingflex">
        <div>
          <img src={props.image} alt="news" />
        </div>
        <div>
          {props.title}
          {props.source}
          {props.publishtime}
          {props.link}
        </div>
      </div>
    </div>
  );
};

export default news;
